import React, { Component } from 'react';
import {Container} from 'semantic-ui-react'
 class Guideline extends Component {
  render() {
    return (
    <div>
      <Container textAlign='center' >GUIDELINE PAGE</Container>
      </div>
    );
  }
}
export default Guideline
